import React from 'react';
import './App.css';

function App() {
  return (
    <>
      <header className="header page__header">
        <img src="<%=require('./images/header-logo.svg')%>" className="header__logo" alt="Логотип сервиса Mesto Russia" />
      </header>
    </>
  )
}

export default App;
